import React from 'react'
import { NavLink,useNavigate  } from 'react-router-dom';
import { LogOut, reset } from "../features/authSlice";
import { useDispatch, useSelector } from "react-redux";
import logo from '../images/logo-dash.svg';
import { HomeIcon,TickSquareIcon, CalendarIcon, DocumentIcon, UsersIcon,AddUserIcon, LocationIcon, ScanIcon, RaportIcon, ActivityIcon, LogoutIcon } from '../common/icons/icons';
const Navbar = () => {
    const dispatch = useDispatch();
  const navigate = useNavigate();
  const { user } = useSelector((state) => state.auth);

    const logout = () => {
        dispatch(LogOut());
        dispatch(reset());
        navigate("/");
    };



    return (
        
       

        <aside className='aside'>
            <div className="nav-logo">
                <NavLink className="nav-logo-a" to="/dashboard"><img className="logo" src={logo} alt="Logo CourierHR" /></NavLink>
            </div>
            <div className="nav-content">
            <ul className="nav-ul">
                <li><NavLink className="nav-a" to="/dashboard"><HomeIcon className="nav-icon"/> Strona główna</NavLink></li>
                <li><NavLink className="nav-a" to="#"><TickSquareIcon className="nav-icon"/> Obecności</NavLink></li>
                <li><NavLink className="nav-a" to="#"><CalendarIcon className="nav-icon"/> Kalendarz</NavLink></li>
                <li><NavLink className="nav-a" to="#"><DocumentIcon className="nav-icon"/> Trasy</NavLink></li>
                <li><NavLink className="nav-a" to="#"><ActivityIcon className="nav-icon" /> Dokumenty</NavLink></li>
                <li><NavLink className="nav-a" to="/users"><UsersIcon className="nav-icon"/> Pracownicy</NavLink></li>
                <li><NavLink className="nav-a" to="#"><AddUserIcon className="nav-icon"/> DodajPraocwnika</NavLink></li>
                <li><NavLink className="nav-a" to="#"><LocationIcon className="nav-icon"/> Trasy Kurierskie</NavLink></li>
                <li><NavLink className="nav-a" to="#"><ScanIcon className="nav-icon"/> Trasy Gazety</NavLink></li>
                <li><NavLink className="nav-a" to="#"><RaportIcon className="nav-icon"/> Raporty</NavLink></li>

            </ul>



                <button  onClick={logout}  className="nav-button"><LogoutIcon className="nav-icon" />Wyloguj się</button>
            </div>
            <div className="nav-footer">

            </div>

        </aside>

      
    )
}

export default Navbar
